import Vue from "vue";
import Router from "vue-router";
import HomePage from "@/components/HomePage";
import TodosPage from "@/components/TodosPage";

Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/",
      name: "HomePage",
      component: HomePage,
    },
    {
      path: "/todos",
      name: "TodosPage",
      component: TodosPage,
    },
  ],
});
